const t=JSON.parse('{"key":"v-082f22b6","path":"/back/springboot/001-SpringBoot%E6%A6%82%E8%BF%B0.html","title":"001-SpringBoot概述","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"1-什么是 SpringBoot？","slug":"_1-什么是-springboot","link":"#_1-什么是-springboot","children":[]},{"level":2,"title":"2-SpringBoot 的特性","slug":"_2-springboot-的特性","link":"#_2-springboot-的特性","children":[]},{"level":2,"title":"3-SpringBoot Starter","slug":"_3-springboot-starter","link":"#_3-springboot-starter","children":[]},{"level":2,"title":"4-什么是\\"约定优于配置\\"？","slug":"_4-什么是-约定优于配置","link":"#_4-什么是-约定优于配置","children":[]}],"git":{"createdTime":1689130625000,"updatedTime":1689130625000,"contributors":[{"name":"deer","email":"2772540969@qq.com","commits":1}]},"readingTime":{"minutes":3.87,"words":1162},"filePathRelative":"back/springboot/001-SpringBoot概述.md","localizedDate":"2023年7月12日","excerpt":"<h1> 001-SpringBoot概述</h1>\\n<h2> 1-什么是 SpringBoot？</h2>\\n<p>在介绍 SpringBoot 之前，先来简单介绍下 Spring。</p>\\n<p>Spring 是诞生于 2002 年的轻量级开源框架，它的出现使得开发者无须开发重量级的 Enterprise JavaBean(EJB)，而是通过**控制反转(IOC)<strong>和</strong>面向切面编程(AOP)**的思想进行更轻松的企业应用开发，取代了EJB 臃肿、低效的开发模式。可以说已经成为 Java 开发的标准。</p>\\n<p>虽然 Spring 框架是轻量级的，但它的配置却是重量级的。Spring 的早期版本专注于 XML 配置，发一个程序需要配置各种 XML 配置文件。为了简化开发，在 Spring 2.x 版本开始引入少量的注解，如 <code>@Component</code>、<code>@Service</code> 等。由于支持的注解不是很多且功能尚不完善，所以只能辅助使用。</p>"}');export{t as data};
